function App() {

  const [toggle, setToggle] = useState(false);

  return (
    <>
      <div className="w-[100vw] flex h-[100vh] overflow-hidden bg-red-600">
        {/* <Aside toggle={true} /> */}
        <div className='flex-grow bg-blue-600 h-[100%] v-[100%] overflow-auto'>  
          <div className="hero">
            <Header toggle={toggle} setToggle={setToggle} />
            {
              toggle?<NavBar/>:""
            }
            <Slider />
          </div>
        </div>
      </div>
    </>
  );
}
function NavBar(){
  return(
    <div className='flex items-center bg-gray-300 justify-center flex-col '>

        <a href='/home'>Home <br/></a>
        <a href='/signup'>Sign Up</a>
        <a href='/login'>Login</a>
        <a href='/consultingandinvestment'>Consulting And Investment</a>
        <a href='/companyoverview'>Comapny Overview</a>
        <a href='/educationcourse'>Education Course</a>
        <a href='/foundingdetails'>Founding Details</a>

    </div>
  )
}

export default App;
